   constructor( public addressService: AddressService) { }
	list:AddressModel[];
	ngOnInit() {
		let item:AddressModel = new AddressModel();
		this.list =[];
		for(let i=0;i<this.tinh.length;i++) {
			item = new AddressModel();
            item.districts =[];	
			item.city = new CityModel();
			item.city.code = this.tinh[i]["ID"];
			item.city.name = this.tinh[i]['Title'];
			for(let j=0;j < this.huyen.length;j++) {
				if(this.huyen[j]["TinhThanhID"] == item.city.code) {
					let a:DistrictModel  = new DistrictModel();
					a.code = this.huyen[j]["ID"];
					a.name= this.huyen[j]["Title"];
					item.districts.push(a)
			}
		this.list.push(item);
		}
		this.str  = JSON.stringify(this.list);
	}
  
  

}
